import React, { Component } from 'react';
import "./styles/Page.css"

class Home extends Component {
  render() {
    return (
      <span className="Page">
      	<div className="banner-home">
      		<div className="title">
				This is my first project using
				ReactJs.
      		</div>
      		<div className="subtitle">
				the logo spins when you hover over it
      		</div>
      		<div>
      			<a href="#title" className="scroll-btn"></a>
      		</div>
      	</div>
      	<section id="page-body">
      		<article className="body-title" id="title">
      			Hello
      		</article>
      	</section>
      </span>
    );
  }
}

export default Home;
